import com.eviware.soapui.impl.wsdl.testcase.WsdlTestCase

def testCase = testRunner.testCase
def endpoints = ['https://mn-dev-haweb15.oldrepublictitle.com:8179', 'https://mn-dev-haweb16.oldrepublictitle.com:8179', 'https://mn-dev-haweb17.oldrepublictitle.com:8179']

for (endpoint in endpoints) {
    if (endpoint == null) {
        endpoint = 'https://mn-dev-haweb15.oldrepublictitle.com:8179'
    }
    testCase.setAmfEndpoint(endpoint)


       def testStep_User = testCase.testSteps['UserService_Status_Dev']
    if (testStep_User != null) {
        testStep_User.setPropertyValue('Endpoint', endpoint)
        testStep_User.run(testRunner, context)
    } else {
        log.error("Test step 'UserService_Status_Dev' not found")
    }

}

